// SPDX-License-Identifier: MIT
pragma solidity ^0.8.9;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";

contract PriceOracleUpgradeable is
    Initializable,
    OwnableUpgradeable,
    UUPSUpgradeable
{
    uint256 private _priceInUSD;
    uint8 private _currencyDecimals;

    function getPriceInUSD() external view returns (uint256) {
        return _priceInUSD;
    }

    function setPriceInUSD(uint256 _valueInWei) external onlyOwner {
        _priceInUSD = _valueInWei;
    }

    function getCurrencyDecimals() external view returns (uint8) {
        return _currencyDecimals;
    }

    function setCurrencyDecimals(uint8 _valueInDecimals) external onlyOwner {
        _currencyDecimals = _valueInDecimals;
    }

    function initialize() public initializer {
        _priceInUSD = 40000000000000000000;
        _currencyDecimals = 18;
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyOwner {}
}

contracts/ReferralV2Upgradeable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/math/SafeMathUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";

interface IERC20_EXTENDED {
    function name() external view returns (string memory);

    function symbol() external view returns (string memory);

    function decimals() external view returns (uint);
}

interface IPriceOracle {
    function getPriceInUSD() external view returns (uint256);
}

contract ReferralV2Upgradeable is
    Initializable,
    PausableUpgradeable,
    OwnableUpgradeable,
    UUPSUpgradeable
{
    using SafeMathUpgradeable for uint256;
    address private _priceOracleContract;

    uint256[] private _levelRates;
    uint256 private _decimals;

    uint256 private _levelsToCounts;

    uint256 private _minContributionInWei;

    uint256 private _totalRoyaltyClubBonusPaidUSD;
    uint256 private _totalRoyaltyClubBonusPaidETH;

    uint256 private _totalUsers;
    uint256 private _totalIDs;
    uint256 private _totalROIIDs;

    uint256 private _roiRate;
    uint256 private _roiDuration;

    address private _defaultReferrer;

    bool private _isPayROI;
    bool private _isPayRoyaltyClubBonus;
    uint256 private _royaltyClubPackageCount;

    uint8 private _userLevelUnlockMultiplier;

    uint256 private _companyTurnoverWithTimeLimit;
    uint256 private _companyTurnoverTimeStamp;
    uint256 private _companyTurnoverTimeLimit;

    uint256 public royaltyPackagesCount;

    address[] private _disabledUsersList;

    struct Account {
        bool isDisabled;
        uint256[] accountInfoArray;
    }

    struct AccountInfo {
        uint256 id;
        bool isActive;
        address owner;
        uint256 joiningTime;
        uint256 activationTime;
        uint256[] roiIDs;
        uint256 refererID;
        uint256[] refereeIDs;
        uint256[] teamIDs;
        uint256[] selfBusinessUSDArray;
        uint256 selfBusinessUSD;
        uint256 selfBusinessETH;
        uint256 directBusinessUSD;
        uint256 directBusinessETH;
        uint256 teamBusinessUSD;
        uint256 teamBusinessETH;
        uint256 royaltyClubBusinessUSD;
        uint256 royaltyClubBusinessETH;
        uint256 timeStampRoyaltyClub;
        uint256 royaltyClubPackageID;
        uint256 royaltyClubListIndex;
        uint256 rewardPaidUSD;
        uint256 rewardPaidETH;
        uint256 rewardPaidRoyaltyClubUSD;
        uint256 rewardPaidRoyaltyClubETH;
        uint256 fundsToActivateIDUSD;
        uint256 balanceClaimedUSD;
        uint256 balanceClaimedETH;
        uint256 limitBalanceUSD;
        uint256 maxLimitAmount;
    }

    struct ROIInfo {
        bool isActive;
        uint256 ownerID;
        uint256 valueInETH;
        uint256 valueInUSD;
        uint256 rewardRate;
        uint256 startTime;
        uint256 duration;
        uint256 rewardClaimed;
        uint256 lastTimeRewardClaimed;
    }

    struct Packages {
        uint256 packageID;
        uint256 selfBusinessUSD;
        uint256 directBusinessUSD;
        uint256 teamBusinessUSD;
        string rankName;
        uint256 reward;
        uint256 businessLimit;
        uint256 timeLimit;
        bool isPayReccursive;
        uint256[] achieversList;
    }

    mapping(address => Account) private accounts;
    mapping(uint256 => AccountInfo) private accountInfoID;
    mapping(uint256 => ROIInfo) private roiInfo;
    mapping(uint256 => Packages) private packages;

    event IDActivated(uint256 id, uint256 valueInUSD, address userAddress);
    event IDDeactivated(uint256 id);

    event AccountInfoIDAttached(
        address ownerAddress,
        uint256 id,
        uint256 idIndex
    );

    event RegisteredReferer(uint256 indexed id, uint256 indexed refererID);

    event RegisteredTeamAddress(
        address indexed parent,
        uint256 parentAccountID,
        uint256 indexed referrerID,
        uint256 indexed refereeID
    );

    event RegisterRefererFailed(
        address indexed refereeID,
        address indexed referrerID,
        string indexed reason
    );

    event ReferralRewardPaid(
        uint256 indexed refereeID,
        uint256 indexed referrerID,
        uint256 indexed amount,
        uint256 level
    );

    event AddedInRoyaltyClubList(uint256 userID, uint256 index, uint256 rank);

    event RoyaltyClubBonusPaid(
        uint256 packageID,
        uint256 indexed userID,
        uint256 indexed amount
    );

    event RemovedFromRoyaltyClubList(
        address indexed userAddress,
        string indexed lastRankName
    );

    event ReferralNotPaid(
        uint256 indexed refererID,
        uint256 indexed level,
        string indexed reason
    );

    event PackageAdded(uint256 packageID);

    event PackageUpdated(uint256 packageID);

    event PackageRemoved(uint256 packageID);

    event ROIActivated(
        address indexed userAddress,
        uint256 indexed valueinUSD,
        uint256 duration,
        uint256 roiID
    );
    event ROIClaimed(
        uint256 indexed userID,
        uint256 indexed roiID,
        uint256 indexed reward
    );

    function initialize() public initializer {
        _defaultReferrer = 0x6fe251C6c6ee58f20F0642522cb76f854820f36a;
        _priceOracleContract = 0xC90c7221bd990b3aFb046d3fba2dE13023ba9eF5;

        _decimals = 1000;
        _levelRates = [
            100,
            70,
            50,
            50,
            50,
            50,
            50,
            50,
            50,
            50,
            50,
            50,
            50,
            50,
            50,
            50,
            50,
            50,
            50,
            20,
            20,
            20,
            20,
            20,
            20,
            20,
            20,
            20,
            20
        ];

        _levelsToCounts = 50;

        _minContributionInWei = 100000000000000000000;

        _userLevelUnlockMultiplier = 2;

        _isPayRoyaltyClubBonus = true;

        _isPayROI = true;

        _roiRate = 1000;
        _roiDuration = 400 days;

        _companyTurnoverTimeLimit = 30 days;

        __Pausable_init();
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    receive() external payable {}

    function getUserAccount(
        address _address
    ) external view returns (Account memory) {
        return accounts[_address];
    }

    function getUserAccountInfo(
        uint256 _id
    ) external view returns (AccountInfo memory) {
        return accountInfoID[_id];
    }

    function getLevelDecimals() external view returns (uint256) {
        return _decimals;
    }

    function getLevelsToCount() external view returns (uint256) {
        return _levelsToCounts;
    }

    function setLevelsToCount(uint256 _valueInDecimals) external onlyOwner {
        _levelsToCounts = _valueInDecimals;
    }

    function setLevelDecimals(uint256 _value) external onlyOwner {
        _decimals = _value;
    }

    function getLevelRates()
        external
        view
        returns (uint256[] memory presale, uint256 totalRatePresale)
    {
        presale = _levelRates;
        uint256 presaleRateLength = presale.length;
        for (uint8 i; i < presaleRateLength; i++) {
            totalRatePresale += presale[i];
        }
    }

    function setLevelRateReferral(
        uint256[] calldata _value
    ) external onlyOwner {
        _levelRates = _value;
    }

    function _getIDRoyalyClubLevel(uint256 _id) private view returns (uint8) {
        AccountInfo memory accountInfo = accountInfoID[_id];
        uint8 prevCount;
        for (uint256 i; i < royaltyPackagesCount; i++) {
            if (
                accountInfo.selfBusinessUSD >= packages[i].selfBusinessUSD &&
                accountInfo.directBusinessUSD >=
                packages[i].directBusinessUSD &&
                accountInfo.teamBusinessUSD >= packages[i].teamBusinessUSD
            ) {
                prevCount = uint8(i);
            } else {
                break;
            }
        }

        return prevCount;
    }

    function getIDRoyaltyClubLevel(uint256 _id) public view returns (uint256) {
        return _getIDRoyalyClubLevel(_id);
    }

    function getRoyaltyClubPackageInfo(
        uint256 _packageID
    ) external view returns (Packages memory) {
        return packages[_packageID];
    }

    function getAchieversList(
        uint256 _packageID
    ) external view returns (uint256[] memory) {
        return packages[_packageID].achieversList;
    }

    function setRoyaltyClubPackage(
        uint256 packageID,
        uint256 selfBusinessUSD,
        uint256 directBusinessUSD,
        uint256 teamBusinessUSD,
        string memory rankName,
        uint256 reward,
        uint256 businessLimit,
        uint256 timeLimit,
        bool isPayReccursive
    ) external onlyOwner {
        Packages storage package = packages[packageID];
        package.packageID = packageID;
        package.selfBusinessUSD = selfBusinessUSD;
        package.directBusinessUSD = directBusinessUSD;
        package.teamBusinessUSD = teamBusinessUSD;
        package.rankName = rankName;
        package.reward = reward;
        package.businessLimit = businessLimit;
        package.timeLimit = timeLimit;
        package.isPayReccursive = isPayReccursive;

        emit PackageAdded(packageID);
    }

    function getRoyaltyClubPackageCount() external view returns (uint256) {
        return royaltyPackagesCount;
    }

    function setRoyaltyPackageCount(
        uint256 _valueInDecimals
    ) external onlyOwner {
        royaltyPackagesCount = _valueInDecimals;
    }

    function payRoyaltyClubReccursiveBonusAdmin() external onlyOwner {
        uint256 _royaltyPackagesCount = royaltyPackagesCount;
        AccountInfo storage zeroIDAccount = accountInfoID[0];

        for (uint256 i; i < _royaltyPackagesCount; i++) {
            Packages memory package = packages[i];
            if (!package.isPayReccursive) {
                continue;
            }

            uint256[] memory acheiversList = package.achieversList;
            uint256 achieversCount = acheiversList.length;
            uint256 valueToDistribute = (_companyTurnoverWithTimeLimit *
                package.reward) /
                _decimals /
                achieversCount;

            for (uint256 j; j < achieversCount; j++) {
                AccountInfo storage userAccountInfoID = accountInfoID[
                    acheiversList[j]
                ];

                if (
                    userAccountInfoID.royaltyClubBusinessUSD >
                    package.businessLimit &&
                    userAccountInfoID.limitBalanceUSD <=
                    userAccountInfoID.maxLimitAmount
                ) {
                    userAccountInfoID.limitBalanceUSD += valueToDistribute;
                    zeroIDAccount.rewardPaidUSD += valueToDistribute;
                    zeroIDAccount.rewardPaidETH += _usdToETH(valueToDistribute);
                    emit RoyaltyClubBonusPaid(
                        package.packageID,
                        acheiversList[j],
                        valueToDistribute
                    );
                }
            }
        }

        _companyTurnoverWithTimeLimit = 0;
        _companyTurnoverTimeStamp = block.timestamp;
    }

    function getDefaultReferrer() public view returns (address) {
        return _defaultReferrer;
    }

    function setDefaultReferrer(address _address) public onlyOwner {
        _defaultReferrer = _address;
    }

    function getIDReferrerAddress(uint256 _id) external view returns (uint256) {
        return accountInfoID[_id].refererID;
    }

    function getIDReferee(
        uint256 _id
    ) external view returns (uint256[] memory referees, uint256 refereesCount) {
        AccountInfo storage id = accountInfoID[_id];
        referees = id.refereeIDs;
        refereesCount = referees.length;
    }

    function getIDTeam(
        uint256 _id
    ) external view returns (uint256[] memory team, uint256 teamCount) {
        AccountInfo storage id = accountInfoID[_id];
        team = id.teamIDs;
        teamCount = team.length;
    }

    function getIDRewardPaid(
        uint256 _id
    )
        external
        view
        returns (
            uint256 rewardPaidUSD,
            uint256 rewardPaidETH,
            uint256 rewardPaidRoyaltyUSD,
            uint256 rewardPaidRoyaltyETH
        )
    {
        AccountInfo storage id = accountInfoID[_id];
        rewardPaidUSD = id.rewardPaidUSD;
        rewardPaidETH = id.rewardPaidETH;
        rewardPaidRoyaltyUSD = id.rewardPaidRoyaltyClubUSD;
        rewardPaidRoyaltyETH = id.rewardPaidRoyaltyClubETH;
    }

    function getIDTotalBusiness(
        uint256 _id
    )
        external
        view
        returns (
            uint256[] memory selfBusinessUSDArray,
            uint256 selfBusinessUSD,
            uint256 selfBusinessETH,
            uint256 directBusinessUSD,
            uint256 directBusinessETH,
            uint256 teamBusinessUSD,
            uint256 teamBusinessETH
        )
    {
        AccountInfo storage id = accountInfoID[_id];
        selfBusinessUSDArray = id.selfBusinessUSDArray;
        selfBusinessUSD = id.selfBusinessUSD;
        selfBusinessETH = id.selfBusinessETH;
        directBusinessUSD = id.directBusinessUSD;
        directBusinessETH = id.directBusinessETH;
        teamBusinessUSD = id.teamBusinessUSD;
        teamBusinessETH = id.teamBusinessETH;
    }

    function _addToTeam(uint256 _userID, uint256 _referrerID) private {
        uint256 levelsToCount = _levelsToCounts;
        for (uint256 i; i < levelsToCount; i++) {
            AccountInfo storage parentAccountID = accountInfoID[_referrerID];
            if (parentAccountID.owner == address(0)) {
                break;
            }

            parentAccountID.teamIDs.push(_userID);

            emit RegisteredTeamAddress(
                parentAccountID.owner,
                parentAccountID.id,
                _referrerID,
                _userID
            );

            _referrerID = parentAccountID.refererID;
        }
    }

    function _addReferrer(uint256 _id, uint256 _referrerID) private {
        accountInfoID[_id].refererID = _referrerID;
        accountInfoID[_referrerID].refereeIDs.push(_id);
        emit RegisteredReferer(_id, _referrerID);
    }

    function _idStatus(
        AccountInfo storage _idAccount
    ) private view returns (bool) {
        return
            _idAccount.limitBalanceUSD >= _idAccount.maxLimitAmount
                ? false
                : true;
    }

    function _activateID(AccountInfo storage _idAccount) private {
        _idAccount.isActive = true;
    }

    function _deactivateID(AccountInfo storage _idAccount) private {
        _idAccount.isActive = false;
        _idAccount.roiIDs = new uint256[](0);
        _disableIDROIs(_idAccount);
    }

    function _idLimitBalance(
        AccountInfo storage _idAccount
    ) private view returns (uint256) {
        return
            _idAccount.limitBalanceUSD >= _idAccount.maxLimitAmount
                ? _idAccount.maxLimitAmount
                : _idAccount.limitBalanceUSD;
    }

    function _increaseIDLimitBalance(
        AccountInfo storage _idAccount,
        uint256 _valueInUSD
    ) private {
        if (
            _idAccount.limitBalanceUSD + _valueInUSD >=
            _idAccount.maxLimitAmount
        ) {
            _idAccount.limitBalanceUSD = _idAccount.maxLimitAmount;
        } else {
            _idAccount.limitBalanceUSD + _valueInUSD;
        }
    }

    function _updateUserIDNewBusiness(
        uint256 _id,
        uint256 _refererID,
        uint256 roiID,
        address _owner,
        uint256 _valueInUSD,
        uint256 _valueInWei,
        uint256 _currenTime
    ) private {
        uint256 levelsToCount = _levelsToCounts;

        AccountInfo storage userIDAccount = accountInfoID[_id];
        AccountInfo storage zeroIDAccount = accountInfoID[0];

        userIDAccount.owner = _owner;
        userIDAccount.refererID = _refererID;
        userIDAccount.roiIDs.push(roiID);
        userIDAccount.joiningTime = _currenTime;
        userIDAccount.activationTime = _currenTime;
        userIDAccount.id = _id;
        userIDAccount.maxLimitAmount = _valueInUSD * 2;
        userIDAccount.selfBusinessUSD += _valueInWei;
        userIDAccount.selfBusinessETH += _valueInWei;
        userIDAccount.selfBusinessUSDArray.push(_valueInUSD);
        userIDAccount.isActive = true;

        zeroIDAccount.teamBusinessUSD += _valueInUSD;
        zeroIDAccount.teamBusinessETH += _valueInWei;
        zeroIDAccount.teamIDs.push(_id);

        for (uint256 i; i < levelsToCount; i++) {
            uint256 refererID = userIDAccount.refererID;
            AccountInfo storage refererIDAccount = accountInfoID[refererID];
            if (refererIDAccount.owner == address(0)) {
                break;
            }

            if (i == 0) {
                refererIDAccount.directBusinessUSD += _valueInUSD;
                refererIDAccount.directBusinessETH += _valueInWei;
            }

            refererIDAccount.teamBusinessUSD += _valueInUSD;
            refererIDAccount.teamBusinessETH += _valueInWei;

            if (
                _getIDRoyalyClubLevel(refererID) >
                refererIDAccount.royaltyClubPackageID
            ) {
                refererIDAccount.royaltyClubPackageID = _getIDRoyalyClubLevel(
                    refererID
                );

                packages[refererIDAccount.royaltyClubPackageID]
                    .achieversList
                    .push(refererID);

                refererIDAccount.royaltyClubListIndex =
                    packages[refererIDAccount.royaltyClubPackageID]
                        .achieversList
                        .length -
                    1;

                emit AddedInRoyaltyClubList(
                    refererID,
                    refererIDAccount.royaltyClubListIndex,
                    refererIDAccount.royaltyClubPackageID
                );

                if (
                    packages[_getIDRoyalyClubLevel(refererID)].isPayReccursive
                ) {
                    if (
                        block.timestamp >
                        refererIDAccount.timeStampRoyaltyClub +
                            packages[_getIDRoyalyClubLevel(refererID)].timeLimit
                    ) {
                        refererIDAccount.timeStampRoyaltyClub = block.timestamp;
                        refererIDAccount.royaltyClubBusinessUSD += _valueInUSD;
                        refererIDAccount.royaltyClubBusinessETH += _valueInWei;
                    } else {
                        refererIDAccount.royaltyClubBusinessUSD += _valueInUSD;
                        refererIDAccount.royaltyClubBusinessETH += _valueInWei;
                    }
                } else {
                    if (_isPayRoyaltyClubBonus) {
                        _increaseIDLimitBalance(
                            refererIDAccount,
                            packages[refererIDAccount.royaltyClubPackageID]
                                .reward
                        );

                        zeroIDAccount.rewardPaidUSD += packages[
                            refererIDAccount.royaltyClubPackageID
                        ].reward;

                        zeroIDAccount.rewardPaidETH += _usdToETH(
                            packages[refererIDAccount.royaltyClubPackageID]
                                .reward
                        );

                        emit RoyaltyClubBonusPaid(
                            packages[refererIDAccount.royaltyClubPackageID]
                                .packageID,
                            refererID,
                            packages[refererIDAccount.royaltyClubPackageID]
                                .reward
                        );
                    }
                }
            }

            if (
                block.timestamp >
                _companyTurnoverTimeStamp + _companyTurnoverTimeLimit
            ) {
                _companyTurnoverTimeStamp = block.timestamp;
                _companyTurnoverWithTimeLimit = _valueInUSD;
            } else {
                _companyTurnoverWithTimeLimit += _valueInUSD;
            }

            refererID = refererIDAccount.refererID;
        }

        _totalIDs++;
    }

    function activateID(uint256 _refererID) external payable whenNotPaused {
        uint256 _valueInWei = msg.value;
        uint256 _valueInUSD = _ethToUSD(_valueInWei);

        require(
            _valueInWei >= _minContributionInWei,
            "Value should be greate then 100"
        );

        address _msgSender = msg.sender;
        uint256 _currenTime = block.timestamp;
        uint256 _id = _totalIDs + 1;
        uint256 roiID = _totalROIIDs + 1;

        Account storage userAccount = accounts[_msgSender];

        _addReferrer(_id, _refererID);
        _addToTeam(_id, _refererID);

        if (_isPayROI) {
            _activateROI(_id, roiID, _valueInUSD, _currenTime);
        }

        _updateUserIDNewBusiness(
            _id,
            _refererID,
            roiID,
            _msgSender,
            _valueInUSD,
            _valueInWei,
            _currenTime
        );

        userAccount.accountInfoArray.push(_id);
    }

    function _updateUserIDTopUp(
        uint256 _id,
        uint256 roiID,
        uint256 _valueInUSD,
        uint256 _valueInWei,
        uint256 _currenTime
    ) private {
        uint256 levelsToCount = _levelsToCounts;

        AccountInfo storage userIDAccount = accountInfoID[_id];
        AccountInfo storage zeroIDAccount = accountInfoID[0];

        userIDAccount.roiIDs.push(roiID);
        userIDAccount.maxLimitAmount = _valueInUSD * 2;
        userIDAccount.selfBusinessUSD += _valueInWei;
        userIDAccount.selfBusinessETH += _valueInWei;
        userIDAccount.selfBusinessUSDArray.push(_valueInUSD);
        userIDAccount.isActive = true;

        zeroIDAccount.teamBusinessUSD += _valueInUSD;
        zeroIDAccount.teamBusinessETH += _valueInWei;
        zeroIDAccount.teamIDs.push(_id);

        for (uint256 i; i < levelsToCount; i++) {
            uint256 refererID = userIDAccount.refererID;
            AccountInfo storage refererIDAccount = accountInfoID[refererID];
            if (refererIDAccount.owner == address(0)) {
                break;
            }

            if (i == 0) {
                refererIDAccount.directBusinessUSD += _valueInUSD;
                refererIDAccount.directBusinessETH += _valueInWei;
            }

            refererIDAccount.teamBusinessUSD += _valueInUSD;
            refererIDAccount.teamBusinessETH += _valueInWei;

            if (
                _getIDRoyalyClubLevel(refererID) >
                refererIDAccount.royaltyClubPackageID
            ) {
                refererIDAccount.royaltyClubPackageID = _getIDRoyalyClubLevel(
                    refererID
                );

                packages[refererIDAccount.royaltyClubPackageID]
                    .achieversList
                    .push(refererID);

                refererIDAccount.royaltyClubListIndex =
                    packages[refererIDAccount.royaltyClubPackageID]
                        .achieversList
                        .length -
                    1;

                emit AddedInRoyaltyClubList(
                    refererID,
                    refererIDAccount.royaltyClubListIndex,
                    refererIDAccount.royaltyClubPackageID
                );

                if (
                    packages[_getIDRoyalyClubLevel(refererID)].isPayReccursive
                ) {
                    if (
                        _currenTime >
                        refererIDAccount.timeStampRoyaltyClub +
                            packages[_getIDRoyalyClubLevel(refererID)].timeLimit
                    ) {
                        refererIDAccount.timeStampRoyaltyClub = _currenTime;
                        refererIDAccount.royaltyClubBusinessUSD += _valueInUSD;
                        refererIDAccount.royaltyClubBusinessETH += _valueInWei;
                    } else {
                        refererIDAccount.royaltyClubBusinessUSD += _valueInUSD;
                        refererIDAccount.royaltyClubBusinessETH += _valueInWei;
                    }
                } else {
                    if (_isPayRoyaltyClubBonus) {
                        _increaseIDLimitBalance(
                            refererIDAccount,
                            packages[refererIDAccount.royaltyClubPackageID]
                                .reward
                        );

                        zeroIDAccount.rewardPaidUSD += packages[
                            refererIDAccount.royaltyClubPackageID
                        ].reward;

                        zeroIDAccount.rewardPaidETH += _usdToETH(
                            packages[refererIDAccount.royaltyClubPackageID]
                                .reward
                        );

                        emit RoyaltyClubBonusPaid(
                            packages[refererIDAccount.royaltyClubPackageID]
                                .packageID,
                            refererID,
                            packages[refererIDAccount.royaltyClubPackageID]
                                .reward
                        );
                    }
                }
            }

            if (
                _currenTime >
                _companyTurnoverTimeStamp + _companyTurnoverTimeLimit
            ) {
                _companyTurnoverTimeStamp = _currenTime;
                _companyTurnoverWithTimeLimit = _valueInUSD;
            } else {
                _companyTurnoverWithTimeLimit += _valueInUSD;
            }

            refererID = refererIDAccount.refererID;
        }

        _totalIDs++;
    }

    function _payReferal(uint256 _valueInUSD, uint256 _id) private {
        uint256[] memory levelRates = _levelRates;
        uint256 levelRatesCount = _levelRates.length;
        AccountInfo storage userAccountID = accountInfoID[_id];
        AccountInfo storage zeroIDAccount = accountInfoID[0];

        uint256 totalReferralInUSD;

        for (uint256 i; i < levelRatesCount; i++) {
            uint256 refererID = userAccountID.refererID;
            AccountInfo storage refererIDAccount = accountInfoID[refererID];
            if (refererIDAccount.owner == address(0)) {
                break;
            }

            if (!refererIDAccount.isActive) {
                emit ReferralNotPaid(refererID, i + 1, "Referer is Inactive");

                refererID = refererIDAccount.refererID;
                continue;
            } else if (
                refererIDAccount.isActive &&
                refererIDAccount.limitBalanceUSD >=
                refererIDAccount.maxLimitAmount
            ) {
                emit ReferralNotPaid(
                    refererID,
                    i + 1,
                    "Reached the limit. Referer is Inactive. "
                );

                _deactivateID(refererIDAccount);

                emit IDDeactivated(refererIDAccount.id);

                refererID = refererIDAccount.refererID;
                continue;
            }

            if (i + 1 > _userLevelUnlockCount(refererIDAccount)) {
                emit ReferralNotPaid(
                    refererID,
                    i + 1,
                    "Downline levels limit reached"
                );

                refererID = refererIDAccount.refererID;

                continue;
            }

            uint256 c = _valueInUSD.mul(levelRates[i]).div(_decimals);

            refererIDAccount.rewardPaidUSD += (c);
            refererIDAccount.rewardPaidETH += _usdToETH(c);

            _increaseIDLimitBalance(refererIDAccount, c);

            totalReferralInUSD += c;

            emit ReferralRewardPaid(_id, refererID, c, i + 1);

            refererID = refererIDAccount.refererID;
        }

        zeroIDAccount.rewardPaidUSD += totalReferralInUSD;
        zeroIDAccount.rewardPaidETH += _usdToETH(totalReferralInUSD);
    }

    function _activateROI(
        uint256 _id,
        uint256 roiID,
        uint256 _valueInUSD,
        uint256 _currentTime
    ) private {
        ROIInfo storage roiAccount = roiInfo[roiID];
        AccountInfo storage userIDAccount = accountInfoID[_id];
        AccountInfo storage zeroIDAccount = accountInfoID[0];

        roiAccount.isActive = true;
        roiAccount.ownerID = _id;
        roiAccount.valueInUSD = _valueInUSD;
        roiAccount.valueInETH = _usdToETH(_valueInUSD);
        roiAccount.rewardRate = _roiRate;
        roiAccount.startTime = _currentTime;
        roiAccount.duration = _roiDuration;

        userIDAccount.roiIDs.push(roiID);
        zeroIDAccount.roiIDs.push(roiID);

        _totalROIIDs++;
    }

    function _disableIDROIs(AccountInfo storage _idAccount) private {
        uint256[] memory idROIIDs = _idAccount.roiIDs;

        for (uint256 i; i < idROIIDs.length; i++) {
            roiInfo[idROIIDs[i]].isActive = false;
        }

        _idAccount.roiIDs = new uint256[](0);
    }

    function _getROI(uint256 roiID) private view returns (uint256 roi) {
        ROIInfo storage roiAccount = roiInfo[roiID];
        uint256 _currentTime = block.timestamp;
        uint256 baseReward = (roiAccount.valueInUSD * _roiRate) /
            _decimals /
            _roiDuration;

        uint256 _timePassed = _currentTime - roiAccount.startTime;

        roi =
            (baseReward * _min(_timePassed, roiAccount.duration)) -
            roiAccount.rewardClaimed;
    }

    function getROI(uint256 _id) external view returns (uint256 totalROI) {
        uint256[] memory roiIDs = accountInfoID[_id].roiIDs;
        uint256 roiIDsCount = roiIDs.length;

        for (uint16 i; i < roiIDsCount; i++) {
            totalROI += _getROI(roiIDs[i]);
        }
    }

    function _claimROIReward(uint256 roiID) private {
        ROIInfo storage idROIID = roiInfo[roiID];
        AccountInfo storage userIDAccount = accountInfoID[idROIID.ownerID];
        AccountInfo storage zeroIDAccount = accountInfoID[0];
        require(
            msg.sender == userIDAccount.owner,
            "You are not owner of this id."
        );

        require(idROIID.isActive, "ROI is not active.");

        uint256 _roiReward = _getROI(roiID);

        if (
            userIDAccount.limitBalanceUSD + _roiReward <=
            userIDAccount.maxLimitAmount
        ) {
            userIDAccount.limitBalanceUSD += _roiReward;
            zeroIDAccount.limitBalanceUSD += _roiReward;
            emit ROIClaimed(idROIID.ownerID, roiID, _roiReward);
        } else {
            uint256 _limitDifference = userIDAccount.maxLimitAmount -
                userIDAccount.limitBalanceUSD;
            emit ROIClaimed(idROIID.ownerID, roiID, _limitDifference);
            userIDAccount.limitBalanceUSD = userIDAccount.maxLimitAmount;
            zeroIDAccount.limitBalanceUSD += _limitDifference;

            _disableIDROIs(userIDAccount);
        }
    }

    function claimROI(uint256 roiID) external whenNotPaused {
        _claimROIReward(roiID);
    }

    function topUpID(uint256 _id) external payable whenNotPaused {
        uint256 _valueInWei = msg.value;

        require(
            _valueInWei >= _minContributionInWei,
            "Value should be greate then minContribution"
        );

        address _msgSender = msg.sender;
        uint256 _valueInUSD = _ethToUSD(_valueInWei);
        uint256 _currenTime = block.timestamp;
        uint256 roiID = _totalROIIDs + 1;

        AccountInfo storage userIDAccount = accountInfoID[_id];

        require(
            userIDAccount.owner == _msgSender,
            "You are not owner of this id."
        );

        if (_isPayROI) {
            _activateROI(_id, roiID, _valueInUSD, _currenTime);
        }
    }

    function _userLevelUnlockCount(
        AccountInfo memory _userIDAccount
    ) private view returns (uint256) {
        uint256 userRefereeCount = _userIDAccount.refereeIDs.length;
        uint256 count;

        if (userRefereeCount > 0) {
            count = userRefereeCount * _userLevelUnlockMultiplier - 1;
        }

        return count;
    }

    function getUserUnlockCount(uint256 _id) external view returns (uint256) {
        AccountInfo memory idAccount = accountInfoID[_id];
        return _userLevelUnlockCount(idAccount);
    }

    function _usdToETH(uint256 _valueInUSD) private view returns (uint256) {
        uint256 value = (_valueInUSD * 10 ** 18) /
            IPriceOracle(_priceOracleContract).getPriceInUSD();
        return value;
    }

    function getUSDToETH(uint256 _valueInUSD) external view returns (uint256) {
        return _usdToETH(_valueInUSD);
    }

    function _ethToUSD(uint256 _valueInWei) private view returns (uint256) {
        uint256 value = (_valueInWei *
            IPriceOracle(_priceOracleContract).getPriceInUSD()) / 10 ** 18;
        return value;
    }

    function getETHToUSD(uint256 _valueInWei) external view returns (uint256) {
        return _ethToUSD(_valueInWei);
    }

    function getDisabledUserList() external view returns (address[] memory) {
        return _disabledUsersList;
    }

    function isUserDisabledByAdmin(
        address _userAddress
    ) external view returns (bool) {
        return accounts[_userAddress].isDisabled;
    }

    function disableUserAdmin(address _userAddress) external onlyOwner {
        _disabledUsersList.push(_userAddress);
        accounts[_userAddress].isDisabled = true;
    }

    function removeUserFromDisableList(
        address _userAddress
    ) external onlyOwner {
        accounts[_userAddress].isDisabled = false;
        uint256 disabledUsersLength = _disabledUsersList.length;

        for (uint256 i; i < disabledUsersLength; i++) {
            if (_disabledUsersList[i] == _userAddress) {
                _disabledUsersList[i] = _disabledUsersList[
                    disabledUsersLength - 1
                ];

                _disabledUsersList.pop();
            }
        }
    }

    function _addInRoyaltyClubList(address _userAddress) private {}

    function _userStatusRoyalyClub(address _userAddress) private {}

    function _inMultipleOf(
        uint256 _valueInUSD,
        uint256 _division
    ) private pure returns (uint256) {
        if (_valueInUSD < 10 * 10 ** 18) {
            return 0;
        }

        uint256 vad = (_valueInUSD / 10 ** 18) / _division;
        return vad * 10 ** 18;
    }

    function isInMultipleOf(
        uint256 _valueInUSD,
        uint256 _division
    ) private pure returns (bool) {
        if (_valueInUSD < 10 * 10 ** 18) {
            return false;
        }

        uint256 vad = (_valueInUSD / 10 ** 18) / _division;
        return vad * _division * 10 ** 18 == _valueInUSD ? true : false;
    }

    function getPriceOracleContract() external view returns (address) {
        return _priceOracleContract;
    }

    function setPriceOracleContract(
        address _contractAddress
    ) external onlyOwner {
        _priceOracleContract = _contractAddress;
    }

    function getIDClaimableBalance(
        uint256 _id
    ) external view returns (uint256) {
        AccountInfo memory id = accountInfoID[_id];
        return id.limitBalanceUSD - id.balanceClaimedUSD;
    }

    function getIDLimitBalance(uint256 _id) external view returns (uint256) {
        return accountInfoID[_id].limitBalanceUSD;
    }

    function getIDMaxLimit(uint256 _id) external view returns (uint256) {
        return accountInfoID[_id].maxLimitAmount;
    }

    function claimBalance(uint256 _id, uint256 _valueInUSD) external {
        AccountInfo storage id = accountInfoID[_id];
        require(id.isActive, "ID is not active");
        require(id.owner == msg.sender, "You are not owner of this id.");
        uint256 userLimitBalance = _idLimitBalance(id);
        uint256 userTotalWithdrawUSD = id.balanceClaimedUSD;
        require(
            _valueInUSD <= userLimitBalance - userTotalWithdrawUSD,
            "Please enter value less then your balance."
        );

        id.balanceClaimedUSD += _valueInUSD;

        payable(msg.sender).transfer(_valueInUSD);

        if (!_idStatus(id)) {
            _deactivateID(id);
        }
    }

    function _min(uint256 x, uint256 y) private pure returns (uint256) {
        if (x > y) {
            return y;
        }

        return x;
    }

    function sendETHAdmin(address _address, uint256 _value) external onlyOwner {
        payable(_address).transfer(_value);
    }

    function withdrawETHAdmin() external onlyOwner {
        payable(msg.sender).transfer(address(this).balance);
    }

    function withdrawTokensAdmin(
        address _tokenAddress,
        uint256 _value
    ) external onlyOwner {
        IERC20Upgradeable(_tokenAddress).transfer(msg.sender, _value);
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyOwner {}
}

contracts/StakingUpgradeable.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts-upgradeable/token/ERC20/IERC20Upgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";

interface IPriceOracle {
    function getPriceInUSD() external view returns (uint256);

    function getCurrencyDecimals() external view returns (uint8);
}

interface IReferral {
    function payReferralETHAdmin(
        uint256 _value,
        address _userAddress,
        address _referrerAddress
    ) external returns (bool);

    function payStakingReferralAdmin(
        uint256 _value,
        address _referee
    ) external returns (bool);

    function payStakingReferralInUSDTAdmin(
        uint256 _value,
        address _referee
    ) external returns (bool);
}

interface IVariables {
    function getContracts()
        external
        view
        returns (
            address presaleContract,
            address referralContract,
            address stakingContract,
            address tokenContract,
            address usdtContract,
            address rewardContract
        );

    function getPresaleContract() external view returns (address);

    function getReferralContract() external view returns (address);

    function getStakingContract() external view returns (address);

    function getTokenPriceInUSD() external view returns (uint256);

    function getUSDTContract() external view returns (address);

    function getRewardContract() external view returns (address);

    function rewardContractOwner() external view returns (address);

    function isUserBalanceLimitReached(
        address _userAddress
    ) external view returns (bool);

    function getUserBalance(
        address _userAddress
    ) external view returns (uint256);

    function increaseUserBalance(address _userAddress, uint256 _value) external;

    function decreaseUserBalance(address _userAddress, uint256 _value) external;

    function setUserBalance(address _userAddress, uint256 _value) external;
}

contract StakingUpgradeable is
    Initializable,
    PausableUpgradeable,
    OwnableUpgradeable,
    UUPSUpgradeable
{
    address private _variablesContract;
    address private _priceOracleContract;

    uint256 private _userIDsCount;
    uint256 private _stakingCount;
    uint256 private _totalValueStaked;
    uint256 private _totalValueStakedUSD;
    uint256 private _totalRewardsDistributed;

    uint16 private _rewardRateDecimals;
    uint256 private _minStakingValueInUSD;

    bool private _isPayReferralOnStaking;
    uint256 private _rewardClaimTimeLimit;

    uint8 private _maxPackageLength;

    uint256 private _minWithdrawLimit;
    uint256 private _minWithdrawLimitMultiplier;

    struct Account {
        uint256 userID;
        uint256[] stakingID;
        bool isDisabled;
        uint256[] blockNumber;
    }

    struct StakeInfo {
        bool isStaked;
        address owner;
        uint256 valueInETH;
        uint256 valueInUSD;
        uint256 rewardRate;
        uint256 startTime;
        uint256 duration;
        uint256 rewardClaimed;
        uint256 lastTimeRewardClaimed;
        uint256[] blockNumber;
    }

    struct Package {
        uint256 value;
        uint256 rewardRate;
        uint256 duration;
    }

    mapping(address => Account) private accounts;
    mapping(uint256 => address) private userID;
    mapping(uint256 => StakeInfo) private stakeInfo;
    mapping(uint256 => Package) private package;

    event Stake(
        address indexed userAddress,
        uint256 indexed valueinUSD,
        uint256 duration,
        uint256 stakingID
    );
    event StakingRewardClaimed(
        address indexed userAddress,
        uint256 indexed reward,
        uint256 indexed stakingID
    );
    event Unstake(
        address indexed userAddress,
        uint256 indexed valueStaked,
        uint256 indexed stakingID
    );

    event UserWithdrawFunds(address indexed userAddress, uint256 indexed value);

    function initialize() public initializer {
        _minStakingValueInUSD = 10000000000000000000;
        _isPayReferralOnStaking = true;
        _rewardRateDecimals = 1000;
        _rewardClaimTimeLimit = 1 days;
        _maxPackageLength = 3;
        _minWithdrawLimit = 10000000000000000000;
        _minWithdrawLimitMultiplier = 10;
        _userIDsCount = 1000;
        _stakingCount = 1000;

        __Pausable_init();
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    receive() external payable {}

    function _getPackage(
        uint256 _packageID
    ) private view returns (Package memory) {
        return package[_packageID];
    }

    function getPackages()
        external
        view
        returns (
            uint256[] memory valuesInDecimals,
            uint256[] memory rewardRateInPer,
            uint256[] memory durationInDays,
            uint256 count
        )
    {
        uint256[] memory _packageValues = new uint256[](_maxPackageLength);
        uint256[] memory _packageRates = new uint256[](_maxPackageLength);
        uint256[] memory _packageDurations = new uint256[](_maxPackageLength);

        for (uint256 i; i < _maxPackageLength; i++) {
            _packageValues[i] = _getPackage(i).value;
            _packageRates[i] = _getPackage(i).rewardRate;
            _packageDurations[i] = _getPackage(i).duration;
            count++;
        }

        valuesInDecimals = _packageValues;
        rewardRateInPer = _packageRates;
        durationInDays = _packageDurations;
    }

    function _setPackage(
        uint256[] memory _valuesInDecimals,
        uint256[] memory _rewardRateInPer,
        uint256[] memory _durationsInDays
    ) private {
        uint256 packageLength = _valuesInDecimals.length;
        require(packageLength <= _maxPackageLength, "Exceeding package length");

        for (uint256 i; i < packageLength; i++) {
            package[i].value = _valuesInDecimals[i];
            package[i].rewardRate = _rewardRateInPer[i];
            package[i].duration = _durationsInDays[i];
        }
    }

    function setPackage(
        uint256[] calldata _valuesInDecimals,
        uint256[] calldata _rewardRateInPer,
        uint256[] calldata _durationsInDays
    ) external onlyOwner {
        _setPackage(_valuesInDecimals, _rewardRateInPer, _durationsInDays);
    }

    function _stakeInfoMap(
        uint256 _stakingID
    ) private view returns (StakeInfo memory) {
        return stakeInfo[_stakingID];
    }

    function stakeInfoMap(
        uint256 _stakingID
    ) external view returns (StakeInfo memory) {
        return stakeInfo[_stakingID];
    }

    function _userAccountMap(
        address _userAddress
    ) private view returns (Account memory) {
        return accounts[_userAddress];
    }

    function userAccountMap(
        address _userAddress
    ) external view returns (Account memory) {
        return accounts[_userAddress];
    }

    function _idToAddress(uint256 _userID) private view returns (address) {
        return userID[_userID];
    }

    function _stake(
        address _address,
        uint256 _valueInUSD,
        uint256 _rewardRate,
        uint256 _duration
    ) private {
        _stakingCount++;

        uint256 _stakingID = _stakingCount;
        uint256 _currentTime = block.timestamp;
        uint256 _currentBlock = block.number;

        Account storage userAccount = accounts[_address];
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];

        if (userAccount.userID == 0) {
            _userIDsCount++;
            userAccount.userID = _userIDsCount;
            userID[_userIDsCount] = _address;
        }

        userAccount.stakingID.push(_stakingID);
        userAccount.blockNumber.push(_currentBlock);

        userStakingInfo.isStaked = true;
        userStakingInfo.owner = _address;
        userStakingInfo.startTime = _currentTime;
        userStakingInfo.duration = _duration;
        userStakingInfo.valueInUSD = _valueInUSD;
        userStakingInfo.rewardRate = _rewardRate;
        userStakingInfo.blockNumber.push(_currentBlock);

        _totalValueStakedUSD += _valueInUSD;

        emit Stake(_address, _valueInUSD, _duration, _stakingID);
    }

    function stake(
        address _referrerAddress,
        uint256 _packageID
    ) external payable whenNotPaused {
        address _msgSender = msg.sender;
        uint256 _msgValue = msg.value;
        uint256 _valueInUSD = _ethToUSD(_msgValue);
        address _referralContract = IVariables(_variablesContract)
            .getReferralContract();
        require(
            _valueInUSD >= _minStakingValueInUSD,
            "Staking value should be >= minStakingValueInUSD."
        );
        Package storage packageInfo = package[_packageID];

        _stake(
            _msgSender,
            _valueInUSD,
            packageInfo.rewardRate,
            packageInfo.duration
        );

        if (_isPayReferralOnStaking) {
            IReferral(_referralContract).payReferralETHAdmin(
                _msgValue,
                _msgSender,
                _referrerAddress
            );
        }
    }

    function stakeByAdmin(
        address _userAddress,
        address _referrerAddress,
        uint256 _valueInWei,
        uint256 _packageID
    ) external onlyOwner whenNotPaused {
        address _msgSender = msg.sender;
        uint256 _valueInUSD = _ethToUSD(_valueInWei);
        address _referralContract = IVariables(_variablesContract)
            .getReferralContract();
        require(
            _valueInUSD >= _minStakingValueInUSD,
            "Staking value should be >= minStakingValue."
        );

        Package storage packageInfo = package[_packageID];

        _stake(
            _userAddress,
            _valueInUSD,
            packageInfo.rewardRate,
            packageInfo.duration
        );

        if (_isPayReferralOnStaking) {
            IReferral(_referralContract).payReferralETHAdmin(
                _valueInWei,
                _msgSender,
                _referrerAddress
            );
        }
    }

    function _getStakingReward(
        uint256 _stakingID
    ) private view returns (uint256 stakingReward) {
        uint256 currentTime = block.timestamp;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        uint256 stakingTimePassed = currentTime - userStakingInfo.startTime;

        uint256 baseReward = ((userStakingInfo.valueInUSD *
            userStakingInfo.rewardRate) / _rewardRateDecimals) /
            userStakingInfo.duration;
        stakingReward =
            baseReward *
            _min(stakingTimePassed, userStakingInfo.duration) -
            userStakingInfo.rewardClaimed;

        return stakingReward;
    }

    function getStakingReward(
        uint256 _stakingID
    ) external view returns (uint256) {
        return _getStakingReward(_stakingID);
    }

    function getUserAllStakingsRewards(
        address _userAddress
    ) external view returns (uint256) {
        uint256[] memory userStakingIDs = accounts[_userAddress].stakingID;
        uint256 stakingIDLength = userStakingIDs.length;
        uint256 userAllStakingRewards;

        for (uint8 i; i < stakingIDLength; i++) {
            if (_stakeInfoMap(userStakingIDs[i]).isStaked == true) {
                userAllStakingRewards += _getStakingReward(userStakingIDs[i]);
            }
        }

        return userAllStakingRewards;
    }

    function _claimReward(
        address _userAddress,
        uint256 _stakingID,
        StakeInfo storage userStakingInfo,
        Account storage userAccount,
        uint256 stakingReward,
        uint256 _currentBlock
    ) private returns (uint256) {
        userStakingInfo.rewardClaimed += stakingReward;
        userStakingInfo.lastTimeRewardClaimed = block.timestamp;
        userStakingInfo.blockNumber.push(_currentBlock);
        userAccount.blockNumber.push(_currentBlock);
        _totalRewardsDistributed += stakingReward;
        emit StakingRewardClaimed(_userAddress, stakingReward, _stakingID);

        return stakingReward;
    }

    function claimStakingReward(uint256 _stakingID) external {
        address _msgSender = msg.sender;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        Account storage userAccount = accounts[_msgSender];
        uint256 _currentBlock = block.number;
        require(
            !userAccount.isDisabled,
            "Your account is disabled. Please contract admin."
        );
        require(userStakingInfo.isStaked == true, "Staking is not active");
        require(userStakingInfo.owner == _msgSender, "Sorry you are not owner");
        require(
            userStakingInfo.lastTimeRewardClaimed + _rewardClaimTimeLimit >
                block.timestamp,
            "Your last reward claim time limit is not over yet."
        );
        uint256 stakingReward = _getStakingReward(_stakingID);

        _claimReward(
            _msgSender,
            _stakingID,
            userStakingInfo,
            userAccount,
            stakingReward,
            _currentBlock
        );
    }

    function claimStakingRewardAdmin(
        uint256[] calldata _stakingIDs
    ) external onlyOwner {
        address userAddress;
        uint256 stakingID;
        uint256 stakingReward;
        StakeInfo storage userStakingInfo = stakeInfo[stakingID];
        Account storage userAccount = accounts[userAddress];
        uint256 _currentBlock = block.number;

        for (uint256 i; i < _stakingIDs.length; i++) {
            stakingID = _stakingIDs[i];
            userAddress = userStakingInfo.owner;
            stakingReward = _getStakingReward(stakingID);

            _claimReward(
                userAddress,
                stakingID,
                userStakingInfo,
                userAccount,
                stakingReward,
                _currentBlock
            );
        }
    }

    function _unStake(
        address _userAddress,
        uint256 _stakingID,
        StakeInfo storage _userStakingInfo,
        Account storage _userAccount,
        uint256 _currentBlock
    ) private returns (uint256) {
        _userStakingInfo.isStaked = false;
        _userStakingInfo.blockNumber.push(_currentBlock);
        _userAccount.blockNumber.push(_currentBlock);

        _totalValueStaked -= _userStakingInfo.valueInUSD;

        emit Unstake(_userAddress, _userStakingInfo.valueInUSD, _stakingID);
        return _userStakingInfo.valueInUSD;
    }

    function unStake(uint256 _stakingID) external {
        address _msgSender = msg.sender;
        uint256 _currentBlock = block.number;
        uint256 _currentTime = block.timestamp;
        Account storage userAccount = accounts[_msgSender];
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        require(
            !userAccount.isDisabled,
            "Your account is disabled. Please contract admin."
        );
        require(userStakingInfo.isStaked, "Staking is not active");
        require(
            userStakingInfo.owner == _msgSender,
            "Sorry you are not owner of this staking"
        );
        require(
            userStakingInfo.startTime + userStakingInfo.duration > _currentTime,
            "You staking is not over yet"
        );

        uint256 stakingReward = _getStakingReward(_stakingID);
        _claimReward(
            _msgSender,
            _stakingID,
            userStakingInfo,
            userAccount,
            stakingReward,
            _currentBlock
        );
        _unStake(
            _msgSender,
            _stakingID,
            userStakingInfo,
            userAccount,
            _currentBlock
        );
    }

    function isStaked(address _userAddress) public view returns (bool) {
        Account storage userAccount = accounts[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            if (_stakeInfoMap(userStakingIDs[i]).isStaked) {
                return true;
            }
        }

        return false;
    }

    function getUserTotalStakedValue(
        address _userAddress
    ) external view returns (uint256 userTotalValueStaked) {
        Account storage userAccount = accounts[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            if (_stakeInfoMap(userStakingIDs[i]).isStaked) {
                userTotalValueStaked += _stakeInfoMap(userStakingIDs[i])
                    .valueInUSD;
            }
        }
    }

    function getUserStakingIDs(
        address _userAddress
    ) public view returns (uint256[] memory) {
        return accounts[_userAddress].stakingID;
    }

    function getUserTotalRewardClaimed(
        address _userAddress
    ) external view returns (uint256 totalRewardClaim) {
        Account storage userAccount = accounts[_userAddress];
        uint256[] memory userStakingIDs = userAccount.stakingID;
        uint256 userStakingIDsLength = userStakingIDs.length;

        for (uint256 i; i < userStakingIDsLength; i++) {
            totalRewardClaim += _stakeInfoMap(userStakingIDs[i]).rewardClaimed;
        }
    }

    function getStakingTimeRemaining(
        uint256 _stakingID
    ) external view returns (uint256) {
        uint256 _currentTime = block.timestamp;
        StakeInfo storage userStakingInfo = stakeInfo[_stakingID];
        uint256 endTime = userStakingInfo.startTime + userStakingInfo.duration;
        if (_currentTime < endTime) {
            return
                userStakingInfo.startTime +
                userStakingInfo.duration -
                _currentTime;
        }

        return 0;
    }

    function isAccountDisabled(
        address _userAddress
    ) public view returns (bool) {
        Account storage userAccount = accounts[_userAddress];
        return userAccount.isDisabled;
    }

    function getDisabledUsersList() external view returns (address[] memory) {
        uint256 totalUsers = _userIDsCount;
        uint256 _userID;
        address _userAddress = _idToAddress(_userID);
        Account storage userAccount = accounts[_userAddress];

        uint256 disabledUsersCount;

        for (uint256 i = 1000; i < totalUsers; i++) {
            _userID = i;
            if (userAccount.isDisabled) {
                disabledUsersCount++;
            }
        }

        address[] memory userAddressArray = new address[](disabledUsersCount);
        disabledUsersCount = 0;

        for (uint256 i = 1000; i < totalUsers; i++) {
            _userID = i;
            if (userAccount.isDisabled) {
                userAddressArray[disabledUsersCount] = _userAddress;
                disabledUsersCount++;
            }
        }

        return userAddressArray;
    }

    function disableAccounts(
        address[] calldata _userAddress
    ) external onlyOwner {
        address userAddress;
        Account storage userAccount = accounts[userAddress];
        uint256 userAddressLength = _userAddress.length;

        for (uint256 i; i < userAddressLength; i++) {
            userAddress = _userAddress[i];
            userAccount.isDisabled = true;
        }
    }

    function enableAccounts(
        address[] calldata _userAddress
    ) external onlyOwner {
        address userAddress;
        Account storage userAccount = accounts[userAddress];
        uint256 userAddressLength = _userAddress.length;

        for (uint256 i; i < userAddressLength; i++) {
            userAddress = _userAddress[i];
            userAccount.isDisabled = false;
        }
    }

    function getActiveStakingIDs() public view returns (uint256[] memory) {
        uint256 totalStakingsCount = _stakingCount;
        uint256 _stakingID;
        StakeInfo storage _userStakingInfo = stakeInfo[_stakingID];
        uint256[] memory activeStakingIDs = new uint256[](totalStakingsCount);
        uint256 activeStakingCount;

        for (uint256 i = 1000; i < _stakingCount; i++) {
            _stakingID = i;
            if (_userStakingInfo.isStaked) {
                activeStakingIDs[activeStakingCount] = _stakingID;
                activeStakingCount++;
            }
        }

        return activeStakingIDs;
    }

    function activeStakersList() external view returns (address[] memory) {
        uint256 totalStakers = _userIDsCount;
        uint256 _userID;
        address _userAddress = _idToAddress(_userID);
        address[] memory activeStakersArray = new address[](totalStakers);
        uint256 activeStakersLength;

        for (uint256 i = 1000; i < totalStakers; i++) {
            _userID = i;

            if (_isAddressInList(activeStakersArray, _userAddress) == true) {
                continue;
            }

            if (isStaked(_userAddress)) {
                activeStakersArray[activeStakersLength] = _userAddress;
                activeStakersLength++;
            }
        }

        return activeStakersArray;
    }

    function usersList() external view returns (address[] memory) {
        uint256 totalStakers = _userIDsCount;
        address[] memory stakersArray = new address[](totalStakers);
        uint256 stakersArrayLength;

        for (uint256 i = 1000; i < totalStakers; i++) {
            stakersArray[stakersArrayLength] = _idToAddress(i);
            stakersArrayLength++;
        }

        return stakersArray;
    }

    function getTotalValueStaked() external view returns (uint256) {
        return _totalValueStaked;
    }

    function getTotalStakingRewardDistributed()
        external
        view
        returns (uint256)
    {
        return _totalRewardsDistributed;
    }

    function getStakingCappings()
        external
        view
        returns (
            uint256 priceInUSD,
            uint256 minStakingValueInUSD,
            uint256 timeLimitRewardClaim,
            bool payReferralOnStaking,
            uint8 maxPackageLength,
            uint256 rewardRateDecimals,
            uint256 minWithdrawLimit,
            uint256 minWithdrawLimitMultiplier
        )
    {
        priceInUSD = IPriceOracle(_priceOracleContract).getPriceInUSD();
        minStakingValueInUSD = _minStakingValueInUSD;
        timeLimitRewardClaim = _rewardClaimTimeLimit;
        payReferralOnStaking = _isPayReferralOnStaking;
        maxPackageLength = _maxPackageLength;
        rewardRateDecimals = _rewardRateDecimals;
        minWithdrawLimit = _minWithdrawLimit;
        minWithdrawLimitMultiplier = _minWithdrawLimitMultiplier;
    }

    function setMinWithdrawLimit(uint256 _valueInWei) external onlyOwner {
        _minWithdrawLimit = _valueInWei;
    }

    function setMinWithdrawLimitMultiplier(
        uint256 _valueInWei
    ) external onlyOwner {
        _minWithdrawLimitMultiplier = _valueInWei;
    }

    function setMinStakingValueInUSD(
        uint256 _valueInUSD
    ) external onlyOwner returns (uint256) {
        _minStakingValueInUSD = _valueInUSD;
        return _minStakingValueInUSD;
    }

    function setTimeLimitRewardClaim(
        uint256 _valueInSeconds
    ) external onlyOwner {
        _rewardClaimTimeLimit = _valueInSeconds;
    }

    function setIsPayReferralOnStaking(
        bool _value
    ) external onlyOwner returns (bool) {
        _isPayReferralOnStaking = _value;
        return _isPayReferralOnStaking;
    }

    function setMaxPackageLength(uint8 _valueInDecimals) external onlyOwner {
        _maxPackageLength = _valueInDecimals;
    }

    function setRewardRateDecimals(uint8 _valueInDecimals) external onlyOwner {
        _rewardRateDecimals = _valueInDecimals;
    }

    function _isAddressInList(
        address[] memory _addressList,
        address _addressToSearch
    ) private pure returns (bool) {
        for (uint256 i; i < _addressList.length; i++) {
            if (_addressList[i] == _addressToSearch) {
                return true;
            }
        }

        return false;
    }

    function isInMultipleOf(
        uint256 _valueInWei,
        uint256 _decimals,
        uint256 _division
    ) private pure returns (uint256) {
        uint256 value = _valueInWei / 10 ** _decimals / _division;
        return value * _division * 10 ** _decimals;
    }

    function getClaimableBalance(
        address _userAddress
    ) external view returns (uint256) {
        uint256 userBalanceUSD = IVariables(_variablesContract).getUserBalance(
            _userAddress
        );

        return
            isInMultipleOf(
                userBalanceUSD,
                IPriceOracle(_priceOracleContract).getCurrencyDecimals(),
                _minWithdrawLimitMultiplier
            );
    }

    function _ethToUSD(uint256 _valueInWei) private view returns (uint256) {
        uint256 value = (_valueInWei *
            IPriceOracle(_priceOracleContract).getPriceInUSD()) / 10 ** 18;
        return value;
    }

    function _usdToETH(uint256 _valueInUSD) private view returns (uint256) {
        uint256 value = (_valueInUSD * 10 ** 18) /
            IPriceOracle(_priceOracleContract).getPriceInUSD();
        return value;
    }

    /*Admin function*/

    function withdrawTokens(
        address _tokenAddress,
        address _receiver,
        uint256 _value
    ) external onlyOwner returns (bool) {
        IERC20Upgradeable(_tokenAddress).transfer(_receiver, _value);
        return true;
    }

    function withdrawNativeFunds(
        address _receiver,
        uint256 _value
    ) external onlyOwner returns (bool) {
        payable(_receiver).transfer(_value);
        return true;
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function _authorizeUpgrade(
        address newImplementation
    ) internal override onlyOwner {}

    function _getCurrentTime() private view returns (uint256 currentTime) {
        currentTime = block.timestamp;
        return currentTime;
    }

    function _min(uint256 a, uint256 b) private pure returns (uint256) {
        return a < b ? a : b;
    }
}

